import Vue from 'vue'
import router from './router'
import { createApp } from 'vue'
import App from './App.vue'

createApp(App)({
    router,
    render: h => h(App),
}).mount('#app')
Vue.config.productionTip = false

new Vue({
    router,
    render: h => h(App),
}).$mount('#app')
